import { services } from '../../assets/dummy.js' 

export const AdminDashboard = () => {
  return (
  <div className="w-full flex justify-center h-full items-center pt-36">
    <div className="flex justify-center items-center h-full w-full p-10 ">
    <div title="Add a service" className="border-4 border-white hover:border-2 fixed bottom-5 right-5 bg-black text-white w-10 h-10 flex justify-center items-center cursor-pointer hover:border-white border-2 border-transparent rounded-full">
      +
    </div>

      <div className="flex flex-col items-center gap-10 w-full max-w-md ">
        {services.map(service => (
        <div className="bg-black w-full rounded-lg h-20 text-white flex justify-center items-center text-sm">
          {service.title}
        </div>
        ))}
      </div>
  </div>

  </div>
    )
}
